import React from "react";
import "../Styles/Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <div className="profile">
        <img src={profilePic} alt="Profile" />
        <span>John Doe</span>
      </div>
    </div>
  );
}

export default Navbar;
